                if(!(eF[ind][inde].SameGender)) { // 이성
                    index = 0
                    for(let ti = 0; ti < temp.length; ti++) {
                        if(eF[ind][inde].Gender == temp[ti].Gender) { // 동성인 경우
                            temp.splice(index, 1)
                            index--
                        }
                        else if(temp[ti].SameGender) { // 이성이지만 상대방이 동성을 원하는 경우
                            temp.splice(index, 1)
