                for(let ti = 0; ti < temp.length; ti++) {
                    let score = 0;
                    // 4. 쌍방 선호 MBTI
                    for(let i = 0; i < temp[ti].WantedMBTI.length; i++) {
                        if(eF[ind][inde].OwnMBTI == temp[ti].WantedMBTI[i]) {score++}
                    }
        
                    // 5. 군필자만 매칭 가능 여부 판단
                    if(eF[ind][inde].O_MilitaryService) {
